import React from 'react'
import PayWithPayPal from './Payment/PayWithPayPal'

function Donations() {
    return (
        <div>
            <PayWithPayPal items={[{name:'test', value:100.10}]} total={100000}  />
        </div>
    )
}

export default Donations
